import React from 'react'

export default function New(props) {
    console.log(props)
    return (
        <div className="row">
        <div className="col-md-6">
        {
                props.weather.map(x => (
                    <h1>{x.wind.speed}</h1>
                ))
            }
        </div>

        </div>
    )
}
